clc; clear;

% Medvedev-Scaillet coefficients for p0n and q0n
% Finds coefficients up to 7 terms
% Can be easily modified to find more terms

syms v mu r kappa thetaV sigma rho cdf pdf y K theta

p0n = inline('(n-2*i)*(n-2*i-1)/(2*i+2)*pi','n','i','pi');
q0n = inline('(qi*(n-1-2*i)*(n-2-2*i) + 2*pi*(n-2*i-2))/(2*n-2*i-2)','n','i','qi','pi');

Q = {'q01','q02','q03','q04','q05','q06','q07'};
P = {'p01','p02','p03','p04','p05','p06','p07'};

N = 7;

%% Coefficients for p0n
p0 = zeros(N,N+1);
for n=1:N
    p0(n,N-n+1) = 1;
    i = 0;
    for j=N-n+3:2:N+1
        p0(n,j) = p0n(n,i,p0(n,j-2));
        i = i+1;
    end
end

%% Coefficients for q0n
q0 = zeros(N,N+1);
for n=1:N
    q0(n,N-n+2) = 1;
    i = 0;
     for j=N-n+4:2:N+1
         q0(n,j) = q0n(n,i,q0(n,j-2),p0(n,j-1));
         i = i+1;
     end
end

% Obtain the C coefficient and its derivatives
C0 = 0;
C0v = 0;
C0vv = 0;

%% First set of polynomials
n = 1;
fprintf('Set 1 polynomials\n')

% Polynomials and their derivatives
[p0n   q0n p1n   q1n p1n_1 q1n_1 p1n_2 q1n_2 p0n_1 q0n_1 p0n_2 q0n_2 dp1n  d2p1n dp0n_1 dp1n_1  dq1n    d2q1n dq0n_1 ...
 dq1n_1 dp0n_2  dp1n_2 d2p0n_1 d2p1n_1 d2p0n_2 d2p1n_2 dq0n_2 dq1n_2 d2q0n_2 d2q1n_2 d2q0n_1 d2q1n_1] ...
= PQHeston(n,N,p0,q0);
p11 = p1n;
q11 = q1n;
p01 = p0n;
q01 = q0n;

% Print the results
fprintf('p11 is of the form p11 = %s \n', char(p1n))
fprintf('q11 is of the form q11 = %s \n', char(q1n))
fprintf('-------------------------------------------\n')
fprintf(' \n');

% Obtain the C1 coefficient
syms pdf cdf y K C1
%Put1 = C1*(p01*cdf + q01*pdf) + p11*cdf + q11*pdf;
Exp1 = sqrt(v)*y*K;
C1 = (Exp1 - p11*cdf - q11*pdf)/(p01*cdf + q01*pdf);
%C1 = solve(Put1 - Exp1,C1);
C1 = subs(C1,theta,y);

% Derivatives of C1
C1v = diff(C1,v);
C1vv = diff(C1,v,2);

%% Second set of polynomials 
n = 2;
fprintf('Set 2 polynomials\n')

% Polynomials and their derivatives
[p0n   q0n p1n   q1n p1n_1 q1n_1 p1n_2 q1n_2 p0n_1 q0n_1 p0n_2 q0n_2 dp1n  d2p1n dp0n_1 dp1n_1  dq1n    d2q1n dq0n_1 ...
 dq1n_1 dp0n_2  dp1n_2 d2p0n_1 d2p1n_1 d2p0n_2 d2p1n_2 dq0n_2 dq1n_2 d2q0n_2 d2q1n_2 d2q0n_1 d2q1n_1] ...
= PQHeston(n,N,p0,q0);
p02 = p0n;
q02 = q0n;

% Volatility derivatives
p1n_1 = p11;
q1n_1 = q11;
p1n_2 = 0;
q1n_2 = 0;
dp1n_1 = diff(p1n_1,theta);
dp1n_2 = diff(p1n_2,theta);
dq1n_1 = diff(q1n_1,theta);
dq1n_2 = diff(q1n_2,theta);
d2p1vt_1 = diff(dp1n_1,v);
dp1v_2   = diff(p1n_2,v);
d2p1vv_2 = diff(p1n_2,v,2);
d2p1vt_2 = diff(dp1n_2,v);
dp1v_1   = diff(p1n_1,v);
d2q1vt_1 = diff(dq1n_1,v);
dq1v_1   = diff(q1n_1,v);
dq1v_2   = diff(q1n_2,v);
d2q1vv_2 = diff(q1n_2,v,2);
d2q1vt_2 = diff(dq1n_2,v);

% Shortcut notation
B01 = p0n_1 + dq0n_1 - theta*q0n_1;
B11 = p1n_1 + dq1n_1 - theta*q1n_1;
B02 = 2*dp0n_1 - theta*p0n_1 + d2q0n_1 - 2*dq0n_1*theta - q0n_1 + q0n_1*theta^2;
B12 = 2*dp1n_1 - theta*p1n_1 + d2q1n_1 - 2*dq1n_1*theta - q1n_1 + q1n_1*theta^2;
B03 = p0n_2 + dq0n_2 - q0n_2*theta;
B13 = p1n_2 + dq1n_2 - q1n_2*theta;
B04 = 2*dp0n_2 - p0n_2*theta + d2q0n_2 - 2*dq0n_2*theta - q0n_2 + q0n_2*theta^2;
B14 = 2*dp1n_2 - p1n_2*theta + d2q1n_2 - 2*dq1n_2*theta - q1n_2 + q1n_2*theta^2;
V1 = dp1v_1 + d2q1vt_1 - theta*dq1v_1;
V2 = dp1v_2 + d2q1vt_2 - theta*dq1v_2;

% Print the forms of p12 and q12
fprintf('p12 is of the form p12 = %s \n', char(p1n))
fprintf('q12 is of the form q12 = %s \n', char(q1n))
fprintf('-------------------------------------------\n')
fprintf(' \n');

% Solve the first PDE for P12
Cn_1 = C1;
Cn_2 = C0;
Cvn_1  = diff(Cn_1,v);
Cvn_2  = diff(Cn_2,v);
Cvvn_2 = diff(Cn_2,v,2);
syms pi21
PDE1 = d2p1n + theta*dp1n - n*p1n ...
     + 1/sqrt(v)*(v - 2*mu)*(Cn_1*dp0n_1 + dp1n_1) ...
     + rho*sigma*sqrt(v)*(-2*(Cvn_1*dp0n_1 + d2p1vt_1) + 1/v*(Cn_1*dp0n_1 + dp1n_1) ...
     + theta/v*(Cn_1*d2p0n_1+d2p1n_1)) ...
     + kappa*(thetaV-v)*(2*(Cvn_2*p0n_2 + dp1v_2) - theta/v*(Cn_2*dp0n_2 + dp1n_2)) ...
     + sigma^2*v*(Cvvn_2*p0n_2 + d2p1vv_2 - theta/v*(Cvn_2*dp0n_2 + d2p1vt_2)...
     + theta^2/4/v^2*(Cn_2*d2p0n_2 + d2p1n_2) + 3*theta/4/v^2*(Cn_2*dp0n_2 + dp1n_2)) ...
     - 2*r*(Cn_2*p0n_2 + p1n_2);
pi21 = solve(PDE1,pi21);
p12 = pi21;

% Solve the second PDE for Q12
syms qi21
PDE2 = -(n+1)*q1n - theta*dq1n + d2q1n + 2*dp1n ...
     + 1/sqrt(v)*(v-2*mu)*(Cn_1*B01 + B11)...
     + rho*sigma*sqrt(v)*(-2*(Cvn_1*B01 + V1) + 1/v*(Cn_1*B01 + B11)) ...
     + rho*sigma*sqrt(v)*theta/v*(Cn_1*B02 + B12) ...
     + kappa*(thetaV-v)*(2*(Cvn_2*q0n_2 + dq1v_2) - theta/v*(Cn_2*B03 + B13)) ...
     + sigma^2*v*(Cvvn_2*q0n_2 + d2q1vv_2 - theta/v*(Cvn_2*B03 + V2)) ...
     + sigma^2*v*(theta^2/4/v^2)*(Cn_2*B04 + B14) ...
     + sigma^2*v*(3*theta/4/v^2)*(Cn_2*B03 + B13) ...
     - 2*r*(Cn_2*q0n_2 + q1n_2);
qi21 = solve(PDE2,qi21);
q12 = qi21*theta;

% Obtain the C2 coefficient
syms C2
Exp2 = -v*y^2*K/2;
C2 = (Exp2 - p12*cdf - q12*pdf)/(p02*cdf + q02*pdf);
C2 = subs(C2,theta,y);

% Derivatives of C2
C2v = diff(C2,v);
C2vv = diff(C2,v,2);


%% Third set of polynomials 
n = 3;
fprintf('Set 3 polynomials\n')

% Polynomials and their derivatives
[p0n   q0n p1n   q1n p1n_1 q1n_1 p1n_2 q1n_2 p0n_1 q0n_1 p0n_2 q0n_2 dp1n  d2p1n dp0n_1 dp1n_1  dq1n    d2q1n dq0n_1 ...
 dq1n_1 dp0n_2  dp1n_2 d2p0n_1 d2p1n_1 d2p0n_2 d2p1n_2 dq0n_2 dq1n_2 d2q0n_2 d2q1n_2 d2q0n_1 d2q1n_1] ...
= PQHeston(n,N,p0,q0);
p03 = p0n;
q03 = q0n;

% Volatility derivatives
p1n_1 = p12;
q1n_1 = q12;
p1n_2 = p11;
q1n_2 = q11;
dp1n_1 = diff(p1n_1,theta);
dp1n_2 = diff(p1n_2,theta);
dq1n_1 = diff(q1n_1,theta);
dq1n_2 = diff(q1n_2,theta);
d2p1vt_1 = diff(dp1n_1,v);
dp1v_2   = diff(p1n_2,v);
d2p1vv_2 = diff(p1n_2,v,2);
d2p1vt_2 = diff(dp1n_2,v);
dp1v_1   = diff(p1n_1,v);
d2q1vt_1 = diff(dq1n_1,v);
dq1v_1   = diff(q1n_1,v);
dq1v_2   = diff(q1n_2,v);
d2q1vv_2 = diff(q1n_2,v,2);
d2q1vt_2 = diff(dq1n_2,v);

% Shortcut notation
B01 = p0n_1 + dq0n_1 - theta*q0n_1;
B11 = p1n_1 + dq1n_1 - theta*q1n_1;
B02 = 2*dp0n_1 - theta*p0n_1 + d2q0n_1 - 2*dq0n_1*theta - q0n_1 + q0n_1*theta^2;
B12 = 2*dp1n_1 - theta*p1n_1 + d2q1n_1 - 2*dq1n_1*theta - q1n_1 + q1n_1*theta^2;
B03 = p0n_2 + dq0n_2 - q0n_2*theta;
B13 = p1n_2 + dq1n_2 - q1n_2*theta;
B04 = 2*dp0n_2 - p0n_2*theta + d2q0n_2 - 2*dq0n_2*theta - q0n_2 + q0n_2*theta^2;
B14 = 2*dp1n_2 - p1n_2*theta + d2q1n_2 - 2*dq1n_2*theta - q1n_2 + q1n_2*theta^2;
V1 = dp1v_1 + d2q1vt_1 - theta*dq1v_1;
V2 = dp1v_2 + d2q1vt_2 - theta*dq1v_2;

% Print the forms of p13 and q13
fprintf('p13 is of the form p13 = %s \n', char(p1n))
fprintf('q13 is of the form q13 = %s \n', char(q1n))
fprintf('-------------------------------------------\n')
fprintf(' \n');

% Solve the first PDE for P13
Cn_1 = C2;
Cn_2 = C1;
Cvn_1  = diff(Cn_1,v);
Cvn_2  = diff(Cn_2,v);
Cvvn_2 = diff(Cn_2,v,2);
syms pi31
PDE1 = d2p1n + theta*dp1n - n*p1n ...
     + 1/sqrt(v)*(v - 2*mu)*(Cn_1*dp0n_1 + dp1n_1) ...
     + rho*sigma*sqrt(v)*(-2*(Cvn_1*dp0n_1 + d2p1vt_1) + 1/v*(Cn_1*dp0n_1 + dp1n_1) ...
     + theta/v*(Cn_1*d2p0n_1+d2p1n_1)) ...
     + kappa*(thetaV-v)*(2*(Cvn_2*p0n_2 + dp1v_2) - theta/v*(Cn_2*dp0n_2 + dp1n_2)) ...
     + sigma^2*v*(Cvvn_2*p0n_2 + d2p1vv_2 - theta/v*(Cvn_2*dp0n_2 + d2p1vt_2)...
     + theta^2/4/v^2*(Cn_2*d2p0n_2 + d2p1n_2) + 3*theta/4/v^2*(Cn_2*dp0n_2 + dp1n_2)) ...
     - 2*r*(Cn_2*p0n_2 + p1n_2);
pi31 = solve(PDE1,pi31);
p13 = pi31*theta;
p13 = subs(p13);
p13 = subs(p13);

% Solve the second PDE for Q12
syms qi31 qi32 qi33
PDE2 = -(n+1)*q1n - theta*dq1n + d2q1n + 2*dp1n ...
     + 1/sqrt(v)*(v-2*mu)*(Cn_1*B01 + B11)...
     + rho*sigma*sqrt(v)*(-2*(Cvn_1*B01 + V1) + 1/v*(Cn_1*B01 + B11)) ...
     + rho*sigma*sqrt(v)*theta/v*(Cn_1*B02 + B12) ...
     + kappa*(thetaV-v)*(2*(Cvn_2*q0n_2 + dq1v_2) - theta/v*(Cn_2*B03 + B13)) ...
     + sigma^2*v*(Cvvn_2*q0n_2 + d2q1vv_2 - theta/v*(Cvn_2*B03 + V2)) ...
     + sigma^2*v*(theta^2/4/v^2)*(Cn_2*B04 + B14) ...
     + sigma^2*v*(3*theta/4/v^2)*(Cn_2*B03 + B13) ...
     - 2*r*(Cn_2*q0n_2 + q1n_2);
%collect(subs(PDE2),theta)
qi31 = solve('(1/4*rho^2*sigma^2/v^(1/2)*y*K/(y*cdf+pdf)-8*qi31)',qi31);
qi32 = solve('(12*qi31+rho*sigma/v^(1/2)*(-1/2*(v-2*mu)*y*K/(y*cdf+pdf)-3/4*rho*sigma*y*K/(y*cdf+pdf))-1/4/v^(1/2)*(v-2*mu)*rho*sigma*y*K/(y*cdf+pdf)-6*qi32+1/4*sigma^2/v^(1/2)*y*K/(y*cdf+pdf)-1/4*rho^2*sigma^2/v^(1/2)*y*K/(y*cdf+pdf))',qi32);
qi33 = solve('-2*r*v^(1/2)*y*K/(y*cdf+pdf)+kappa*(thetaV-v)/v^(1/2)*y*K/(y*cdf+pdf)-4*qi33-1/2*y*K/v^(1/2)*(2*v^2*cdf-8*v*cdf*mu+y*v*rho*sigma*pdf+2*y^2*v^2*cdf+2*y*v^2*pdf+8*cdf*mu^2-2*y*mu*rho*sigma*pdf-4*y^2*v*mu*cdf-4*y*v*mu*pdf-8*rho*sigma*cdf*mu+2*rho^2*sigma^2*y*pdf+4*r*v*y^2*cdf+4*r*v*cdf+4*r*v*y*pdf)/(y^3*cdf^2+y*cdf^2+2*y^2*cdf*pdf+pdf*cdf+y*pdf^2)+1/v^(1/2)*(v-2*mu)*(-1/2*y*K*(2*v*cdf-4*cdf*mu+y*rho*sigma*pdf+2*y^2*v*cdf+2*y*v*pdf)/(y*cdf+pdf)/(cdf*y^2+cdf+y*pdf)+(1/2*v-mu)*y*K/(y*cdf+pdf)+1/4*rho*sigma*y*K/(y*cdf+pdf))+2*qi32-1/4*sigma^2/v^(1/2)*y*K/(y*cdf+pdf)+rho*sigma*v^(1/2)*(y*K*(2*cdf+2*cdf*y^2+2*y*pdf)/(y*cdf+pdf)/(cdf*y^2+cdf+y*pdf)-y*K/(y*cdf+pdf)+1/v*(-1/2*y*K*(2*v*cdf-4*cdf*mu+y*rho*sigma*pdf+2*y^2*v*cdf+2*y*v*pdf)/(y*cdf+pdf)/(cdf*y^2+cdf+y*pdf)+(1/2*v-mu)*y*K/(y*cdf+pdf)+1/4*rho*sigma*y*K/(y*cdf+pdf)))',qi33);
q13 = qi31*theta^4 + qi32*theta^2 + qi33;
q13 = subs(q13);
q13 = subs(q13);
q13 = subs(q13);

% Obtain the C3 coefficient
syms C3
Exp3 = v^(3/2)*y^3*K/6;
C3 = (Exp3 - p13*cdf - q13*pdf)/(p03*cdf + q03*pdf);
C3 = subs(C3,theta,y);
C3 = subs(C3);
C3 = subs(C3);
C3 = subs(C3);

% Derivatives of C3
C3v = diff(C3,v);
C3vv = diff(C3,v,2);

%% Fourth set of polynomials 
n = 4;
fprintf('Set 4 polynomials\n')

% Polynomials and their derivatives
[p0n   q0n p1n   q1n p1n_1 q1n_1 p1n_2 q1n_2 p0n_1 q0n_1 p0n_2 q0n_2 dp1n  d2p1n dp0n_1 dp1n_1  dq1n    d2q1n dq0n_1 ...
 dq1n_1 dp0n_2  dp1n_2 d2p0n_1 d2p1n_1 d2p0n_2 d2p1n_2 dq0n_2 dq1n_2 d2q0n_2 d2q1n_2 d2q0n_1 d2q1n_1] ...
= PQHeston(n,N,p0,q0);
p04 = p0n;
q04 = q0n;

% Volatility derivatives
p1n_1 = p13;
q1n_1 = q13;
p1n_2 = p12;
q1n_2 = q12;
dp1n_1 = diff(p1n_1,theta);
dp1n_2 = diff(p1n_2,theta);
dq1n_1 = diff(q1n_1,theta);
dq1n_2 = diff(q1n_2,theta);
d2p1vt_1 = diff(dp1n_1,v);
dp1v_2   = diff(p1n_2,v);
d2p1vv_2 = diff(p1n_2,v,2);
d2p1vt_2 = diff(dp1n_2,v);
dp1v_1   = diff(p1n_1,v);
d2q1vt_1 = diff(dq1n_1,v);
dq1v_1   = diff(q1n_1,v);
dq1v_2   = diff(q1n_2,v);
d2q1vv_2 = diff(q1n_2,v,2);
d2q1vt_2 = diff(dq1n_2,v);

% Shortcut notation
B01 = p0n_1 + dq0n_1 - theta*q0n_1;
B11 = p1n_1 + dq1n_1 - theta*q1n_1;
B02 = 2*dp0n_1 - theta*p0n_1 + d2q0n_1 - 2*dq0n_1*theta - q0n_1 + q0n_1*theta^2;
B12 = 2*dp1n_1 - theta*p1n_1 + d2q1n_1 - 2*dq1n_1*theta - q1n_1 + q1n_1*theta^2;
B03 = p0n_2 + dq0n_2 - q0n_2*theta;
B13 = p1n_2 + dq1n_2 - q1n_2*theta;
B04 = 2*dp0n_2 - p0n_2*theta + d2q0n_2 - 2*dq0n_2*theta - q0n_2 + q0n_2*theta^2;
B14 = 2*dp1n_2 - p1n_2*theta + d2q1n_2 - 2*dq1n_2*theta - q1n_2 + q1n_2*theta^2;
V1 = dp1v_1 + d2q1vt_1 - theta*dq1v_1;
V2 = dp1v_2 + d2q1vt_2 - theta*dq1v_2;

% Print the forms of p14 and q14
fprintf('p14 is of the form p14 = %s \n', char(p1n))
fprintf('q14 is of the form q14 = %s \n', char(q1n))
fprintf('-------------------------------------------\n')
fprintf(' \n');

% Solve the first PDE for P14
Cn_1 = C3;
Cn_2 = C2;
Cvn_1  = diff(Cn_1,v);
Cvn_2  = diff(Cn_2,v);
Cvvn_2 = diff(Cn_2,v,2);
syms pi41 pi42
PDE1 = d2p1n + theta*dp1n - n*p1n ...
     + 1/sqrt(v)*(v - 2*mu)*(Cn_1*dp0n_1 + dp1n_1) ...
     + rho*sigma*sqrt(v)*(-2*(Cvn_1*dp0n_1 + d2p1vt_1) + 1/v*(Cn_1*dp0n_1 + dp1n_1) ...
     + theta/v*(Cn_1*d2p0n_1+d2p1n_1)) ...
     + kappa*(thetaV-v)*(2*(Cvn_2*p0n_2 + dp1v_2) - theta/v*(Cn_2*dp0n_2 + dp1n_2)) ...
     + sigma^2*v*(Cvvn_2*p0n_2 + d2p1vv_2 - theta/v*(Cvn_2*dp0n_2 + d2p1vt_2)...
     + theta^2/4/v^2*(Cn_2*d2p0n_2 + d2p1n_2) + 3*theta/4/v^2*(Cn_2*dp0n_2 + dp1n_2)) ...
